import React from "react";

function Square({ value }) {
  return <button className="square">1</button>
}

export default function Board() {
  return (
  <>
    {/* button is a JSX element */}
    <div className="board-row">
      <Square />
      <Square />
      <Square />
    </div>
    <div className="board-row">
      <Square />
      <Square />
      <Square />
    </div>
    <div className="board-row">
      <Square />
      <Square />
      <Square />
    </div>
  </>
  );
}
